description:
This is a tool for high stakes players, that get rake back, to calculate their rakeback and winnings. Small nifty program, must have if you play at the Crypto network.

&quot;CryptoCounter is a handy tool that counts your raked hands, searches for specific starting hands, and calculates your winnings and attributed rake for poker sites on the Cryptologic network by reading the log files stored on your hard drive. CryptoCounter is a stand-alone program that doesn't require you to be logged into any poker site.
An accurate count is just seconds away!&quot;
